// ConfirmationComponentStyles.js
const confirmationContainerStyle = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  margin: '20px',
};

const sectionHeadingStyle = {
  fontWeight: 'bold',
  fontSize: '1.2rem',
  margin: '10px 0',
};

const confirmButtonStyle = {
  marginTop: '10px',
  padding: '8px',
  cursor: 'pointer',
};

export { confirmationContainerStyle, sectionHeadingStyle, confirmButtonStyle };
